import React from "react";

function Table() {
  return (
    <div>
      <table className="table">
        <thead>
          <tr>
            <th>Task Id</th>
            <th>Task Title</th>
            <th>Task Description</th>
          </tr>
        </thead>
      </table>
    </div>
  );
}

export default Table;
